insert into StationReadings (StationName, Province, Date, MeanTemp,  HighestMonthlyTemp, LowestMonthlyTemp) select "Station_Name", "Province", PARSEDATETIME("Date",'dd/mm/yyyy'), "Mean_Temp", "Highest_Monthly_Maxi_Temp", "Lowest_Monthly_Min_Temp" from CSVREAD('src/main/resources/eng-climate-summary.csv', 'Station_Name,Province,Date,Mean_Temp,Highest_Monthly_Maxi_Temp,Lowest_Monthly_Min_Temp', null);
